import React from 'react';

const Navbar = () => {
  return (
    <div>
      <div className='navbar'>
        <h1>Welcome to SHOPify</h1>
        <h3><a href="/">Home</a></h3>
        <h3><a href="/login">Login</a></h3>
        <h3><a href="/signup">Signup</a></h3>
        <h3><a href="/cart">Cart</a></h3>
      </div>
    </div>
  );
}

export default Navbar;
